面向对象的三个特征：封装，继承，多态
1.封装
1.1 封装的原则，将类的某些信息隐藏在内部，不允许外部程序直接访问，而是通过该类提供的方法（get/set）来实现对隐藏信息的操作和访问成员变量(private)
1.2 封装的好处

通过方法控制成员变量的操作，提高代码安全性

把代码用方法进行封装，提高了代码的复用性


2.继承

继承可以使得子类具有父类的属性和方法，还可以在子类中重新定义，追加属性和方法。
子类可以有父类的内容，也可以有自己的内容

2.1 继承的好处和弊端
好处

提高了代码的复用性
提高了代码的维护性

弊端

继承让类与类之间产生了关系，增强了类的耦合性，当父类大声变化时子类实现也要发生变化，降低了子类的独立性。

注意事项
单继承
多层继承    子—父—爷
2.1super关键字
访问本类中父类的成员变量 
4.继承中构造方法的访问特点

子类会继承父类中的数据，可能还会使用父类的数据。所以，子类初始化之前，一定要先完成对父类数据的初始化。
每一个子类构造方法第一条语句默认都是super()

5.继承中成员方法的访问特点
3.多态
同一个对象，在不同时刻表现出来的不同形态
3.1 多态的前提和提现

有继承/实现关系
有方法重写
有父类引用指向子类对象

3.2 多态的好处和弊端

提高程序的扩展性
不能使用子类的特有功能

3.3多态的转型
通过父—子 向下转型，可以解决多态的弊端
4.多态的形式
具体类多态，抽象类多态，接口多态。
4.抽象类--对事物的抽象
一个没有方法体的方法应该定义为抽象方法，而类中如果有抽象方法，该类必须定义为抽象类
不能直接实例化，但是可以通过子类对象来实例化,称为抽象类多态
5.接口--对行为的抽象-公共的规范标准

接口中的成员变量默认被final修饰，也默认被静态修饰。//public static final int num=1;  
接口—对行为进行抽象— //public abstract void method();

6.类和接口的关系

类和接口的关系:单实现、多实现、继承一个类的同时实现多个接口
接口和接口的关系:单继承、多继承

7.抽象类和接口的关系--设计理念区别
抽象类-对类进行抽象、接口-对行为进行抽象
package base.absDemo;
